import React from 'react'
import { Outlet, Link } from "react-router-dom";

const Layout = () => {
    return(
        <div style={{backgroundColor:"red"}}>
                <li>
                    <Link to="/blogs">Blogs</Link>
                </li>
                <li>
                    <Link to="/contact">Contact</Link>
                </li>
            <Outlet />
        </div>
    )
}
export default Layout
